import React from 'react'
import Maincom from './Maincom'
import Rightmain from './Rightmain'
import "./Superdiv.css"

const Mainsuper = () => {
  return (
    <div style={{ display: 'flex', flexDirection: 'row' }} className='super'>
        <Maincom/>
        <Rightmain/>
    </div>
  )
}

export default Mainsuper
